import React from 'react'
import "./Cont.scss"

import { makeStyles } from '@material-ui/core/styles';
import { TextField } from '@material-ui/core';
import Button from '@material-ui/core/Button';


const Style = makeStyles({
    btn: {
      margin: "0.5rem 0",
      width: "100%",
      background: "red",
      height: "3rem",
      color: "#fff",
      "&:hover": {
        color: "red",
        transition: ".5s ease-in-out"
      }
    },
    disbtn: {
      background: "rgb(0,0,0, 0.38)",
      width: "100%",
      height: "3rem"
    },
    error: {
      color: "red",
      width: "100%",
      textAlign: "center",
      fontSize: "smaller"
  
    }
  })

const Cont = () => {
    return (
        <>

            <div className="Central_div">


                <div className="Middle_div">
                    <span className="cont_contact">CONTACT US</span>

                    <div className="inputs">
                        <TextField name="fname" label="First Name" variant="outlined"
                            style={{ width: "100%", marginRight: "23px" }} />


                        <TextField type="text" id="outlined-basic" label="Last Name" variant="outlined"
                            style={{ width: "100%", marginRight: "2%" }} />


                        <TextField id="outlined-basic" label="Email Adress" variant="outlined"
                            style={{ width: "100%", marginRight: "2%", color: "black" }} />


                    </div>

                    <div className="textfield">
                        <TextField
                            id="outlined-multiline-static"
                            label="Entre Your Text Here"
                            multiline
                            rows={10}
                            style={{ width: "98%", marginTop: "2%" }}

                            variant="outlined"
                        />
                    </div>

                    <div className="button">
                        <Button
                            variant="contained"
                            type="submit"

                            // className={classes.btn}
                        >
                            SIGN UP
                  </Button>
                    </div>


                </div>


            </div>

        </>
    )
}

export default Cont
